import React from 'react';
import styles from '../styles/NFTCard.module.css'

function NFTCard(props) {
    return (
        <div className={styles.nftcard}>
            <img src={props.imgURL}>
            </img>
            <p1>{props.name}</p1>
        </div>

    );
}

export default NFTCard;
